import React from 'react';

import './user-list.styles.css';

class UserList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            users: [
                {
                    "id": 1,
                    "name": "Leanne Graham",
                    "email": "Sincere@april.biz",
                    "age": 36,
                    "address": [
                        {
                            "street": "Kulas Light",
                            "suite": "Apt. 556",
                            "city": "Gwenborough",
                            "zipcode": "92998-3874"
                        },
                        {
                            "street": "Kattie Turnpike",
                            "suite": "Suite 198",
                            "city": "Lebsackbury",
                            "zipcode": "31428-2261"
                        }
                    ],
                    "phone": "1-770-736-8031 x56442"
                }, {
                    "id": 2,
                    "name": "Ervin Howell",
                    "email": "Shanna@melissa.tv",
                    "age": 46,
                    "address": [
                        {
                            "street": "Victor Plains",
                            "suite": "Suite 879",
                            "city": "Wisokyburgh",
                            "zipcode": "90566-7771"
                        },
                        {
                            "street": "Kattie Turnpike",
                            "suite": "Suite 198",
                            "city": "Lebsackbury",
                            "zipcode": "31428-2261"
                        }
                    ],
                    "phone": "010-692-6593 x09125"
                }, {
                    "id": 3,
                    "name": "Clementine Bauch",
                    "email": "Nathan@yesenia.net",
                    "age": 33,
                    "address": [
                        {
                            "street": "Kulas Light",
                            "suite": "Apt. 556",
                            "city": "Gwenborough",
                            "zipcode": "92998-3874"
                        },
                        {
                            "street": "Douglas Extension",
                            "suite": "Suite 847",
                            "city": "McKenziehaven",
                            "zipcode": "59590-4157"
                        }
                    ],
                    "phone": "1-463-123-4447"
                }
            ]
        };
    }
    render() {
        return (
            <div className="user-list">
                <table className="table">
                    <thead className="thead-dark">
                        <tr>
                            <th scope="col">Id</th>
                            <th scope="col">Name</th>
                            <th scope="col">Age</th>
                            <th scope="col">phone</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.users.map(user => {
                                return (
                                    <tr key={user.email}>
                                        <td>{user.id}</td>
                                        <td>{user.name}</td>
                                        <td>{user.age}</td>
                                        <td>{user.phone}</td>
                                    </tr>
                                );
                            })
                        }
                    </tbody>
                </table>
            </div>
        );
    };
}

export default UserList;
